import './index.css'
import 'react-bootstrap'

range = document.getElementById("range")
document.getElementById("numero").value = 10
range.addEventListener("change", function () {
    document.getElementById("numero").value = range.value
})


function Range() {
    return (
        <div className="range">
            <label className="form-check-label" for="flexSwitchCheckDefault">Numero de Caracteres</label>
            <div className="deep-range">
                <input type="text" id="numero" className="numero" disabled />
                <input type="range" id="range" min="0" max="20" step="1" />
            </div>
        </div>



    )
}

export default Range
